// frontend/src/components/Overview.jsx
import React, { useEffect, useState } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import Card from './Card';
import './overview.css';

function Overview({ seeds }) {
  // No need for state and useEffect here since seeds are passed as props

  return (
    <section id="overview" className="section">

      <h1>Dashboard</h1>
      <Tabs>
        <TabList>
          <Tab><Overview /></Tab>
          <Tab>Security</Tab>
          <Tab>Monitoring</Tab>
          <Tab>Recommendations</Tab>
        </TabList>

        <TabPanel>
          <h2>Overview</h2>
          {/* Add the content for Overview here */
             <div className="cards">
             {seeds.map((seed) => (
               <Card key={seed.SeedID} title={seed.SeedType} value={seed.SeedQuantity} unit="seeds" />
             ))}
           </div>
           }
        </TabPanel>
        <TabPanel>
          <h2>Coppell Office Content</h2>
          {/* Add the content for Coppell Office here */}
        </TabPanel>
        <TabPanel>
          <h2>Los Angeles Office Content</h2>
          {/* Add the content for Los Angeles Office here */}
        </TabPanel>
      </Tabs>

    </section>
  );
}

export default Overview;
